メーカー希望小売価格はメーカーサイトに基づいて掲載しています。<br><br>
<table width="495"><tr>
  <td><span class="item_desc">UGG Dakota [ 5296 ]<br>
<br>
ウィメンズで人気の高いDakota。<br>
そのDakotaからキッズサイズが登場！<br>
1日中快適に着用できるかわいいカジュアルシューズ★<br>
キッズサイズですが、大人の方でもご使用いただけます♪<br><br>
ベーシックなモカシンのシルエットに、革のリボンでかわいらしさをプラス。<br>

スリッポン式だからブーツと違い、着脱が簡単なのも嬉しいポイント★<br><br>

柔軟性・耐久性ともに優れているので、履き心地も快適！<br>
靴底にはUGGのロゴが凸凹になっているので滑りにくく、安定感があり長時間歩いても疲れにくいのが魅力的♪<br>
軽量・無公害のEVA素材を使用しています。<br><br>

ふわふわの天然ウールで快適な履き心地！<br>
ボリュームのあるファーで足全体を包んでくれます。<br><br>

<br>
<br>
<br>
■サイズ：<br>
13　⇒　約19.5cm<br>
1　⇒　約20cm<br>
2　⇒　約21cm<br>
3　⇒　約22cm<br>
4　⇒　約23cm<br>
5　⇒　約24cm<br>
6　⇒　約25cm<br>
<br>※サイズは目安となっております。個人差がございます。ご了承ください。
